{
    "name": "emojione/emojione",
    "type": "library",
    "description": "EmojiOne is a complete set of emojis designed for the web. It includes libraries to easily convert unicode characters to shortnames (:smile:) and shortnames to our custom emoji images. PNG format provided for the emoji images.",
    "keywords": ["emojione","EmojiOne","emoji","emojis","emoticons","smileys","smilies","unicode"],
    "homepage": "http://www.emojione.com",
    "license": "(CC-BY-4.0 and MIT)",
    "autoload": {
        "psr-4": {
            "Emojione\\": "lib/php/src"
        }
    },
    "require": {
        "php": ">=5.3"
    },
    "require-dev": {
        "phpunit/phpunit": "~4.6 || ~5.0"
    }
}

module.exports = function(grunt) {
    grunt.initConfig({
        pkg: grunt.file.readJSON('package.json'),
        jshint: {
            files: ['gruntfile.js', 'lib/js/emojione.js']
        },
        jsonlint: {
            files: {
                src: ['emoji.json','emoji_strategy.json']
            }
        },
        // BUILD EMOJI ONE AWESOME CSS (SASS -> CSS)
        sass: {
            dist: {
                files: {
                    'extras/css/emojione-awesome.css': 'lib/emojione-awesome/emojione-awesome.scss'
                }
            }
        },
        uglify: {
            options: {
                // the banner is inserted at the top of the output
                banner: '/*! <%= pkg.name %> <%= grunt.template.today("dd-mm-yyyy") %> */\n',
				mangle: false,
				ASCIIOnly: true
            },
            dist: {
                files: {
                    'lib/js/<%= pkg.name %>.min.js': ['lib/js/<%= pkg.name %>.js']
                }
            }
        },
        // Minify Project CSS
        cssmin: {
            target: {
                files: {
                    'extras/css/emojione.min.css': ['extras/css/emojione.css']
                }
            }
        },
        watch: {
            files: ['<%= jshint.files %>'],
            tasks: ['jshint']
        },
        // run QUnit tests
        qunit: {
            all: ['lib/js/tests/tests.html']
        }

    });
    grunt.loadNpmTasks('grunt-contrib-sass');
    grunt.loadNpmTasks('grunt-contrib-uglify');
    grunt.loadNpmTasks('grunt-contrib-jshint');
    grunt.loadNpmTasks('grunt-jsonlint');
    grunt.loadNpmTasks('grunt-contrib-watch');
    grunt.loadNpmTasks('grunt-contrib-cssmin');
    grunt.loadNpmTasks('grunt-contrib-qunit');
    grunt.registerTask('default', ['jshint','jsonlint', 'sass', 'uglify', 'cssmin']);
    grunt.registerTask('travis', ['qunit']);
};

Package.describe({
  name: 'emojione:emojione',
  summary: 'Meteor Package of the https://www.emojione.com/ set.',
  version: '4.5.0',
  git: 'https://github.com/emojione/emojione.git'
});

Package.onUse(function(api) {
  api.versionsFrom('1.0.2.1');

  api.addFiles([
    'lib/meteor/pre-export.js',
    'lib/js/emojione.js',
    'lib/meteor/post-export.js'
  ]);

  api.use([
    'blaze',
    'htmljs',
    'templating'
  ], 'client');

  api.addFiles([
    'lib/meteor/emojione-client.js',
    'extras/css/emojione.css',
    'extras/css/emojione-awesome.css'
  ], 'client');

  api.addAssets('../emojione-assets/sprites/emojione-sprite-32.min.css', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-activity.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-diversity.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-flags.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-food.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-nature.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-objects.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-people.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-regional.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-symbols.png', 'client');
  api.addAssets('../emojione-assets/sprites/emojione-sprite-32-travel.png', 'client');

  api.export('emojione');
});
